                    code: `/**
                    * @param {number[]} nums
                    * @return {number}
                    */
                   var search = function(nums,target) {
                       let l = 0;
                       let r = nums.length - 1;
                       while (l <= r) {
                         const m = l + parseInt((r - l) / 2);
                         if (nums[m] == target)
                           return true;
                         if (nums[l] == nums[m] && nums[m] == nums[r]) {
                           ++l;
                           --r;
                         } else if (nums[l] <= nums[m]) {  
                           if (nums[l] <= target && target < nums[m])
                             r = m - 1;
                           else
                             l = m + 1;
                         } else {  
                           if (nums[m] < target && target <= nums[r])
                             l = m + 1;
                           else
                             r = m - 1;
                         }
                       }
                   
                       return false;
                   };
                   
                   search([2,5,6,0,0,1,2],0)`,
