                    if (!root) return 0;
                    if (!root.left)
                      return topDownDFS(root.right) + 1;
                    if (!root.right)
                      return topDownDFS(root.left) + 1;
                    return Math.min(topDownDFS(root.left), topDownDFS(root.right)) + 1;
