                codes: {
                  Javascript: {
                    code: `/**
                    * @param {string} s
                    * @return {number}
                    */
                   var minCut = function(s) {
                     const n = s.length
                     const cut = Array(n).fill(0)
                     const dp = Array.from(Array(n),()=>Array(n).fill(false)) 
                     for(let i=0;i<n;i++){
                       let min = i
                       for(let j=0;j<i+1;j++){
                         if(s[j] == s[i] && (j + 1 > i - 1 || dp[j + 1][i - 1])){
                           dp[j][i] = true
                           if(j==0) min = 0
                           else min = Math.min(min, cut[j - 1] + 1)
                         } 
                       }
                       cut[i] = min
                     }
                     return cut[n-1]
                   };
                   
                   minCut("aab")`,
                    output: `1`,
                  },
                },
