                    code: `/**
                    * @param {number[]} nums
                    * @return {number}
                    */
                   // O(32n) = )(n) O(1)
                   
                   function bit(nums){
                     let ans = 0;
                     for (let i = 0; i < 32; ++i) {
                       let sum = 0;
                       for (let n of nums)
                         sum += (n >> i) & 1;
                       sum %= 3;
                       ans |= (sum << i);
                     }
                     return ans;
                   }
                   
                   function magic(nums){
                     let ones = twos = 0;
                     for (let n of nums) {
                     ones ^= (num & ~twos);
                     twos ^= (num & ~ones);
                     }
                     return ones;
                   }
                   
                   var singleNumber = function(nums) {
                     return bit(nums)
                   };
                   
                   singleNumber([2,2,3,2])`,
                    output: `3`,
