                   var findRepeatedDnaSequences = function(s) {
                     const ans = new Set()
                     const seen = new Set()
                     for (let i = 0; i + 10 <= s.length; ++i) {
                     const seq = s.substring(i, i + 10);
                     if (seen.has(seq))
                     ans.add(seq);
                     seen.add(seq);
                     }
                     return Array.from(ans)
                   };
                   
