                     const n = grid[0].length
                     let res = 0
                     for (let i = 0; i < m; ++i)
                      for (let j = 0; j < n; ++j)
                        if (grid[i][j] == '1') {
                          dfs(grid, i, j);
                          ++res;
                        }
                     return res
