                    code: `/**
                    * @param {number} n
                    * @return {boolean}
                    */
                   var isUgly = function(n) {
                     if (n == 0) return false;
                     for (let prime of [2, 3, 5])
                       while (n % prime == 0)
                         n = parseInt(n/prime);
                     return n == 1;
                   };
                   
                   isUgly(6)`,
