                   var findDuplicate = function(nums) {
                     let slow = nums[nums[0]];
                     let fast = nums[nums[nums[0]]];
                     while (slow != fast) {
                       slow = nums[slow];
                       fast = nums[nums[fast]];
                     }
                     slow = nums[0];
                     while (slow != fast) {
                       slow = nums[slow];
                       fast = nums[fast];
                     }
                     return slow;
                   };
