               var licenseKeyFormatting = function(s, k) {
                 let res = ""
                 let length = 0;
                 for (let i = s.length - 1; i >= 0; --i) {
                   if (s[i] == '-')
                     continue;
                   if (length > 0 && length % k == 0)
                     res += "-";
                   res += s[i].toUpperCase();
                   ++length;
                 }
                 return res.split("").reverse().join("");
               };
               
