                code: `/**
                * @param {number[][]} mat
                * @return {number[]}
                */
               var findDiagonalOrder = function(mat) {
                 const m = mat.length;
                 const n = mat[0].length;
                 const res = Array(m * n).fill(0);
                 let d = 1; 
                 let row = 0;
                 let col = 0;
                 for (let i = 0; i < m * n; ++i) {
                   res[i] = mat[row][col];
                   row -= d;
                   col += d;
                   if (row == m) {
                     row = m - 1;
                     col += 2;
                     d = -d;
                   }
                   if (col == n) {
                     col = n - 1;
                     row += 2;
                     d = -d;
                   }
                   if (row < 0) {
                     row = 0;
                     d = -d;
                   }
                   if (col < 0) {
                     col = 0;
                     d = -d;
                   }
                 }
                 return res;
               };
               
               console.log(findDiagonalOrder([[1,2,3],[4,5,6],[7,8,9]]))`,
